import React from "react";
import { Link } from "react-router-dom";
const Navbar = () => {
  return (
    <>
      <Link to = "/">Home</Link>
      <Link to = "/">Auth</Link>
      <Link>create recipe</Link>
      <Link>saved recipe</Link>
    </>
  );
};

export default Navbar;
